import React, {Component} from 'react';
import { Grid, Cell} from 'react-mdl';


class Resume extends Component {
    render() {
        return (
            <div>
                <Grid>
                    <Cell col={4}>
                    Left Side
                    <img alt="avatar" src="./profile.jpg" width="250px"/>
                    </Cell>
                    <Cell col={8} className="resume-right-col">
                    Right Side
                    </Cell>
                </Grid>
            </div>
        );
    }
}

export default Resume;
